import { Center } from "@chakra-ui/react";
import { gymInformation } from "../dummy";

const HereDetailScreen = () => {
  const { name } = gymInformation;
  return (
    <div className="mx-auto">
      <Center
        w="100%"
        h="40"
        borderWidth="1px"
        borderRadius="lg"
        color="white"
        bg="blue.500"
        maxW="lg"
      >
        {name}
      </Center>
      <div>detail</div>
    </div>
  );
};

export default HereDetailScreen;
